import React, { Component } from 'react'
import { Link} from 'react-router-dom'

class Nav extends Component {

 render() {
  return(
   <nav>
      {
        localStorage.token !== "undefined" || localStorage.length > 0
      }
       <Link to="/profile">Profile</Link>
       <Link to="/login">Login</Link>

   </nav>
    )
   }
 }



export default Nav
